  \"2013-03-19T00:36:04.497391\",\n\t\"name\": \"geologic-map-of-the-circle-mining-district-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides detailed (1:63,360-scale)
  mapping of portions of U.S. Geological Survey Circle B-2 (1955), B-3 (1955), B-4
  (1952), C-2 (1955), C-3 (1955), and C-4 (1952) quadrangles. The area is part of
  the Circle mining district and adjacent to the Fairbanks mining district. This report
  includes detailed geologic, structural, stratigraphic, and geochronologic data.
  Based on the resulting geologic maps, field investigations, and laboratory materials
  analyses, the project has also generated derivative maps of geologic construction
  materials and geologic hazards.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
